import { makeTypedQueryFactory as $mkFactory } from "@prisma/client/runtime/library"
export const getSimilarNodes = /*#__PURE__*/ $mkFactory("\n\nSELECT n.*\nFROM \"Embedding\" e\nJOIN \"Note\" n\nON e.\"noteid\" = n.\"noteid\"\nWHERE (e.embedding <=> $1::vector) <= 0.5\nORDER BY e.embedding <=> $1::vector\nLIMIT 10;\n\n")
